tables.table_schema:
CREATE TABLE QuantumPrograms (
    id INT PRIMARY KEY,
    program_name VARCHAR(255),
    quantum_structure JSON,
    logical_representation JSON
);

CREATE TABLE QuantumPrograms (Id INT PRIMARY KEY,
ProgramName VARCHAR(255),
Structure TEXT);

CREATE TABLE quantum_programs (
    program_id UUID PRIMARY KEY,
    program_name VARCHAR(255),
    program_structure JSONB
);

CREATE TABLE logical_representations (
    representation_id UUID PRIMARY KEY,
    program_id UUID REFERENCES quantum_programs(program_id),
    representation_data JSONB
);

CREATE TABLE quantum_gates (
    gate_id UUID PRIMARY KEY,
    gate_name VARCHAR(50),
    gate_matrix JSONB
);

CREATE TABLE quantum_programs (
    id INT PRIMARY KEY,
    program_name VARCHAR(255),
    author VARCHAR(255),
    creation_date DATE
);

CREATE TABLE quantum_steps (
    step_id INT PRIMARY KEY,
    program_id INT,
    step_description TEXT,
    step_order INT
);

CREATE TABLE quantum_gates (
    gate_id INT PRIMARY KEY,
    gate_name VARCHAR(255),
    gate_description TEXT
);

CREATE TABLE logical_representations (
    representation_id INT PRIMARY KEY,
    program_id INT,
    logical_structure JSON
);

CREATE TABLE quantum_programs (
    program_id SERIAL PRIMARY KEY,
    program_name VARCHAR(255) NOT NULL,
    program_description TEXT,
    created_at TIMESTAMP
);

CREATE TABLE quantum_circuits (
    circuit_id SERIAL PRIMARY KEY,
    circuit_name VARCHAR(255) NOT NULL,
    circuit_layout TEXT,
    created_at TIMESTAMP
);

CREATE TABLE quantum_gates (
    gate_id SERIAL PRIMARY KEY,
    gate_name VARCHAR(100) NOT NULL,
    gate_description TEXT,
    gate_matrix JSONB
);

CREATE TABLE logical_qubits (
    qubit_id SERIAL PRIMARY KEY,
    qubit_label VARCHAR(50) NOT NULL,
    qubit_type ENUM('data', 'ancilla', 'control'),
    qubit_status ENUM('idle', 'active', 'error')
);
